  render: () => <div className="space-y-8">\r
      <div className="text-center space-y-4">\r
        <h1 className="text-3xl font-bold">🏗️ Application Structure</h1>\r
        <p className="text-xl text-muted-foreground max-w-3xl mx-auto">\r
          Complete application architecture and user experience framework for\r
          financial modeling\r
        </p>\r
      </div>\r
\r
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">\r
        {/* Data Visualization */}\r
        <Card className="hover:shadow-lg transition-shadow">\r
          <CardHeader>\r
            <CardTitle className="flex items-center space-x-2">\r
              <span className="text-2xl">📊</span>\r
              <span>Data Visualization</span>\r
            </CardTitle>\r
            <CardDescription>\r
              Advanced financial charts, graphs, and analytics components\r
            </CardDescription>\r
          </CardHeader>\r
          <CardContent>\r
            <div className="space-y-2 text-sm">\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-blue-500 rounded-full"></div>\r
                <span>Interactive Charts</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-green-500 rounded-full"></div>\r
                <span>Financial Metrics</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-purple-500 rounded-full"></div>\r
                <span>Trend Analysis</span>\r
              </div>\r
            </div>\r
          </CardContent>\r
        </Card>\r
\r
        {/* Business Features */}\r
        <Card className="hover:shadow-lg transition-shadow">\r
          <CardHeader>\r
            <CardTitle className="flex items-center space-x-2">\r
              <span className="text-2xl">⚙️</span>\r
              <span>Business Features</span>\r
            </CardTitle>\r
            <CardDescription>\r
              Core business intelligence and operational tools\r
            </CardDescription>\r
          </CardHeader>\r
          <CardContent>\r
            <div className="space-y-2 text-sm">\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-blue-500 rounded-full"></div>\r
                <span>Parameter Management</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-green-500 rounded-full"></div>\r
                <span>Scenario Analysis</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-purple-500 rounded-full"></div>\r
                <span>Business Intelligence</span>\r
              </div>\r
            </div>\r
          </CardContent>\r
        </Card>\r
\r
        {/* Financial Modeling */}\r
        <Card className="hover:shadow-lg transition-shadow">\r
          <CardHeader>\r
            <CardTitle className="flex items-center space-x-2">\r
              <span className="text-2xl">💰</span>\r
              <span>Financial Modeling</span>\r
            </CardTitle>\r
            <CardDescription>\r
              Comprehensive modeling and valuation frameworks\r
            </CardDescription>\r
          </CardHeader>\r
          <CardContent>\r
            <div className="space-y-2 text-sm">\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-blue-500 rounded-full"></div>\r
                <span>DCF Analysis</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-green-500 rounded-full"></div>\r
                <span>Scenario Modeling</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-purple-500 rounded-full"></div>\r
                <span>Financial Statements</span>\r
              </div>\r
            </div>\r
          </CardContent>\r
        </Card>\r
\r
        {/* Authentication */}\r
        <Card className="hover:shadow-lg transition-shadow">\r
          <CardHeader>\r
            <CardTitle className="flex items-center space-x-2">\r
              <span className="text-2xl">🔐</span>\r
              <span>Authentication</span>\r
            </CardTitle>\r
            <CardDescription>\r
              Secure user management and access control\r
            </CardDescription>\r
          </CardHeader>\r
          <CardContent>\r
            <div className="space-y-2 text-sm">\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-blue-500 rounded-full"></div>\r
                <span>Login Systems</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-green-500 rounded-full"></div>\r
                <span>User Registration</span>\r
              </div>\r
              <div className="flex items-center space-x-2">\r
                <div className="w-2 h-2 bg-purple-500 rounded-full"></div>\r
                <span>Security Protocols</span>\r
              </div>\r
            </div>\r
          </CardContent>\r
        </Card>\r
      </div>\r
\r
      <div className="bg-muted/50 p-6 rounded-lg">\r
        <h3 className="text-lg font-semibold mb-4">\r
          Application Architecture Overview\r
        </h3>\r
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">\r
          <div>\r
            <h4 className="font-medium mb-2">Core Framework</h4>\r
            <ul className="space-y-1 text-sm text-muted-foreground">\r
              <li>• Modular component architecture</li>\r
              <li>• Consistent design patterns</li>\r
              <li>• Responsive layout system</li>\r
              <li>• Accessibility compliance</li>\r
            </ul>\r
          </div>\r
          <div>\r
            <h4 className="font-medium mb-2">Integration Points</h4>\r
            <ul className="space-y-1 text-sm text-muted-foreground">\r
              <li>• Seamless data flow between modules</li>\r
              <li>• Shared state management</li>\r
              <li>• Unified navigation system</li>\r
              <li>• Consistent user experience</li>\r
            </ul>\r
          </div>\r
        </div>\r
      </div>\r
    </div>,
  parameters: {
    docs: {
      description: {
        story: 'Comprehensive overview of the Application Structure framework, showcasing all major components and their integration points.'
      }
    }
  }
